import { motion, useMotionValue } from "framer-motion"
import './style/FrontPage.scss'
import { Link } from "react-router-dom";


const FrontPage = () => {
  const v = useMotionValue(0);
  console.log(v);
  return (
      <div className="page">
        <motion.div 
          animate={{opacity: [0, 1]}} 
          whileHover={{color: ["#000000","#ef4824"]}}
          style={{v}}
        >
          <div className="text">
            زاك
          </div>
          <div className="text">
            ZACH HUSSEIN
          </div>
        </motion.div>

        <Link to="home" className="smalltext">ENTER</Link>
      </div>
  )
}

export default FrontPage
